import React from "react";
import "./Home.css";
import { Grid } from "semantic-ui-react";

const Review = (props) => (
  <main className="Home_main" style={{ background: "#6b7a8fff" }}>
    <Grid columns={2}>
      <Grid.Column width={8}>
        <img
          src={require("./Home_SchoolReviews.png")}
          alt="School Reviews Homepage Logo"
          width="60%"
        ></img>
      </Grid.Column>
      <div className="Review__text">
        <p className="Review__body">
          School review page offers information and senior reviews on each
          school available. You can make use of the side navigation bar to
          navigate through the different schools in the various continents and
          countries. Each school review page will try to cover similar areas of
          the author's experience, for example Location, School Culture, Modules
          to Map, Accomodations and so on!
        </p>
      </div>
    </Grid>{" "}
  </main>
);

export default Review;
